import React from 'react';

const arrowUnfold = () => {
  return (
    <span role="img" aria-label="menu-fold" tabindex="-1" class="anticon anticon-arrow-unfold trigger">
      <svg width="18" height="18" viewBox="0 0 18 18" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M4.4569 10.1035L8.0731 13.7197L7.7197 14.0731L2.64656 8.99998L7.7197 3.92683L8.0731 4.28023L4.4569 7.89642L3.60335 8.74998H4.81045H15.25V9.24998H4.81045H3.60335L4.4569 10.1035Z" fill="black" stroke="black"/>
      </svg>
    </span>
  )
}

export default arrowUnfold;
